import React from 'react';
import Tweet from './Tweet';

class BadgesList extends React.Component{

    render(){
        return(
            <ul className="list-unlysted">
                {this.props.tweets.data.map(tweet=>{
                    return(
                        <li>
                            <Tweet username={tweet.username}/>
                        </li>
                    );
                })}
            </ul>
        )
    }
}

export default BadgesList
